import React from "react";
import "./App.css";
import profile from "./assets/profile.jpg";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import ProjectDetails from "./ProjectDetails";
import { Link } from "react-router-dom";
import Particles from "react-tsparticles";
import { loadFull } from "tsparticles";

function App() {

  // Load particles engine
  const particlesInit = async (main) => {
    await loadFull(main);
  };

  // Mouse Parallax Effect
  React.useEffect(() => {
    const handleMouseMove = (e) => {
      const hero = document.querySelector(".hero");
      const x = (window.innerWidth / 2 - e.clientX) / 40;
      const y = (window.innerHeight / 2 - e.clientY) / 40;
      hero.style.backgroundPosition = `${x}px ${y}px`;
    };

    window.addEventListener("mousemove", handleMouseMove);
    return () => window.removeEventListener("mousemove", handleMouseMove);
  }, []);

  return (
    <Router>
      <Routes>

        <Route
          path="/"
          element={
            <div>

              {/* Navbar */}
              <nav className="navbar">
                <h2>Yashaswin M</h2>
                <ul>
                  <li><a href="#about">About</a></li>
                  <li><a href="#skills">Skills</a></li>
                  <li><a href="#projects">Projects</a></li>
                  <li><a href="#contact">Contact</a></li>
                </ul>
              </nav>

              {/* Hero Section */}
              <section className="hero">

                {/* Floating AI Particles */}
                <Particles
                  id="tsparticles"
                  init={particlesInit}
                  options={{
                    fullScreen: false,
                    background: { color: "transparent" },
                    particles: {
                      number: { value: 60 },
                      color: { value: "#00c6ff" },
                      links: {
                        enable: true,
                        color: "#00c6ff",
                        distance: 150,
                        opacity: 0.3,
                      },
                      move: {
                        enable: true,
                        speed: 1,
                      },
                      size: { value: 2 },
                    },
                  }}
                />

                {/* Rotating AI Sphere */}
                <div className="ai-sphere"></div>

                <div className="hero-content">

                  <img
                    src={profile}
                    alt="Yashas Kamble"
                    className="profile-img"
                  />

                  <h1 className="hero-title">
                    Hi, I'm <span>Yashaswin</span>
                  </h1>

                  <p className="hero-subtitle">
                    <span className="typing-line line1">
                      AI & ML Engineer
                    </span>
                    <br />
                    <span className="typing-line line2">
                      MERN Stack Developer
                    </span>
                    <br />
                    <span className="typing-line line3">
                      Full Stack Developer
                    </span>
                  </p>

                  <div className="hero-buttons">
                    <a href="/resume.pdf" download>
                      <button className="primary-btn">
                        Download My Resume
                      </button>
                    </a>
                  </div>

                </div>
              </section>

              {/* About Section */}
              <section id="about" className="section">
                <h2>ABOUT ME</h2>
                <p>I am an AIML student with a strong interest in Machine Learning and Deep Learning.</p>
                <p>I have hands-on experience in Python and have worked on projects using deep learning models.</p>
                <p>I enjoy solving real-world problems using AI and am actively seeking internship opportunities.</p>
              </section>

              {/* Skills Section */}
              <section id="skills" className="section">
                <h2>SKILLS</h2>
                <div className="skills">
                  <span>HTML</span>
                  <span>CSS</span>
                  <span>JavaScript</span>
                  <span>React</span>
                  <span>Node.js</span>
                  <span>MongoDB</span>
                </div>
              </section>

              {/* Projects Section */}
              <section id="projects" className="section">
                <h2 className="section-title">PROJECTS</h2>

                <div className="project-card">
                  <Link to="/project/resume">
                    <h3>AI Based Resume Builder</h3>
                  </Link>
                </div>

                <div className="project-card">
                  <Link to="/project/retinopathy">
                    <h3>Diabetic Retinopathy Detection System</h3>
                  </Link>
                </div>
              </section>

              {/* Contact Section */}
              <section id="contact" className="section">
                <h2>CONTACT ME</h2>
                <div className="contact-info">
                  <p><strong>Name:</strong> Yashaswin M</p>
                  <p><strong>Phone:</strong> 6360167744</p>
                  <p><strong>Email:</strong> yashaskamble02@gmail.com</p>
                </div>
              </section>

            </div>
          }
        />

        <Route path="/project/:id" element={<ProjectDetails />} />

      </Routes>
    </Router>
  );
}

export default App;
